function createCustomIcon (feature, latlng) {
  let myIcon = L.icon({
    iconUrl: 'lib/images/waste_disposal.png',
    iconSize:     [45, 45], // width and height of the image in pixels
    shadowSize:   [35, 20], // width, height of optional shadow image
    iconAnchor:   [12, 12], // point of the icon which will correspond to marker's location
    shadowAnchor: [12, 6],  // anchor point of the shadow. should be offset
    popupAnchor:  [0, 0] // point from which the popup should open relative to the iconAnchor
  })
  return L.marker(latlng, { icon: myIcon })
}

// create an options object that specifies which function will called on each feature
let myLayerOptions = {
  pointToLayer: createCustomIcon
}
L.geoJSON(jangombeData,myLayerOptions).addTo(map);
L.geoJSON(sebleniData,myLayerOptions).addTo(map);
L.geoJSON(jBuilding).addTo(map);
L.geoJSON(sebBuilding).addTo(map);
function getColor(d) {
    return d > 0 ? '#800026' :
           d > 1  ? '#BD0026' :
           d > 3  ? '#E31A1C' :
           d ==0  ? '#FC4E2A' :
           d > 50   ? '#FD8D3C' :
           d > 20   ? '#FEB24C' :
           d > 10   ? '#FED976' :
                      '#FFEDA0';
}
var legend = L.control({position: 'bottomleft'});
legend.onAdd = function (map) {

var div = L.DomUtil.create('div', 'info legend');
labels = ['<strong>Categories</strong>'],
categories = ['Road Surface','Signage','Line Markings','Roadside Hazards','Other'];

for (var i = 0; i < categories.length; i++) {

        div.innerHTML += 
        labels.push(
            '<i class="circle" style="background:' + getColor(categories[i]) + '"></i> ' +
        (categories[i] ? categories[i] : '+'));

    }
    div.innerHTML = labels.join('<br>');
return div;
};
